-- ----------------------------
-- Table structure for `autoPose`
-- ----------------------------
DROP TABLE IF EXISTS `autoPose`;
CREATE TABLE `autoPose` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '唯一标识ID',
  `compreID` varchar(50) NOT NULL DEFAULT '' COMMENT '压缩ID',
  `factoryName` varchar(50) NOT NULL DEFAULT '' COMMENT '厂家',
  `brandName` varchar(50) NOT NULL DEFAULT '' COMMENT '品牌',
  `autoLineName` varchar(50) NOT NULL DEFAULT '' COMMENT '车系',
  `autoTypeName` varchar(50) NOT NULL DEFAULT '' COMMENT '车型',
  `generationNum` varchar(50) NOT NULL DEFAULT '' COMMENT '代数',
  `codeName` varchar(50) NOT NULL DEFAULT '' COMMENT '代号',
  `firstProductTime` varchar(50) NOT NULL DEFAULT '' COMMENT '最早生产年份',
  `lastProductTime` varchar(50) NOT NULL DEFAULT '' COMMENT '最晚停产年份',
  `engineModel` varchar(50) NOT NULL DEFAULT '' COMMENT '发动机型号',
  `engineDisp` varchar(50) NOT NULL DEFAULT '' COMMENT '排量(升)',
  `oilType` varchar(50) NOT NULL DEFAULT '' COMMENT '燃油类型',
  `maxPower` varchar(50) NOT NULL DEFAULT '' COMMENT '最大功率',
  `transDesc` varchar(50) NOT NULL DEFAULT '' COMMENT '变速器描述',
  `drivingType` varchar(50) NOT NULL DEFAULT '' COMMENT '驱动方式',
  `blueLabel` varchar(50) NOT NULL DEFAULT '' COMMENT '蓝标',
  `silverLabel` varchar(50) NOT NULL DEFAULT '' COMMENT '银标',
  `agm` varchar(50) NOT NULL DEFAULT '' COMMENT 'AGM（如此款车型带启停功能）',
  `recAction` varchar(50) NOT NULL DEFAULT '' COMMENT '0，新增；1，修改；2，删除',
  PRIMARY KEY (`id`),
  KEY `factory_brand_carLine_carModel` (`factoryName`,`brandName`,`autoLineName`,`autoTypeName`)
) ENGINE=InnoDB AUTO_INCREMENT=7148 DEFAULT CHARSET=utf8mb4 COMMENT='车配件知识库';

