-- ----------------------------
-- Table structure for `order`
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(200) NOT NULL DEFAULT '' COMMENT '订单流水号',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `seller_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '卖家ID',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态：0，新建，2，待发货，3，待收货，4，待支付，5，已完成，6，已取消',
  `money_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总现金价格',
  `express_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '快递费用',
  `money_paid` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已经支付的现金',
  `create_ip` varchar(50) NOT NULL DEFAULT '' COMMENT '下单IP',
  `member_address_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '会员收货地址设置ID',
  `order_remark` varchar(2000) NOT NULL DEFAULT '' COMMENT '订单备注',
  `deliver_time` datetime NOT NULL DEFAULT '3000-12-31 00:00:00' COMMENT '发货时间',
  `finish_time` datetime NOT NULL DEFAULT '3000-12-31 00:00:00' COMMENT '完成时间',
  `source` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单来源：0，天猫，1，京东',
  `supply_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '供货商',
  `goods_id` varchar(100) NOT NULL DEFAULT '' COMMENT '货品Id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `seq` bigint(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='订单';

-- ----------------------------
-- Records of order
-- ----------------------------

