-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '用户名称',
  `nick_name` varchar(100) NOT NULL DEFAULT '' COMMENT '昵称',
  `openId` varchar(50) NOT NULL DEFAULT '' COMMENT '昵称',
  `password` varchar(100) NOT NULL DEFAULT '' COMMENT '密码',
  `user_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '用户类型',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码',
  `gender` tinyint(2) NOT NULL DEFAULT '0' COMMENT '性别：0，保密，1，男，2，女',
  `birthday` date NOT NULL DEFAULT '3000-12-31' COMMENT '生日',
  `last_login_time` datetime NOT NULL DEFAULT '3000-12-31 00:00:00' COMMENT '最后登录时间',
  `last_login_ip` varchar(20) NOT NULL DEFAULT '' COMMENT '最后登录IP',
  `email` varchar(100) NOT NULL DEFAULT '' COMMENT '邮箱',
  `mobile_checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '手机号校验',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态：0，正常，1，冻结，9，删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COMMENT='会员';

-- ----------------------------
-- Records of user
-- ----------------------------

