DROP TABLE IF EXISTS `user_address`;
CREATE TABLE `user_address` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `user_name` varchar(100) NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `province_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '省ID',
  `city_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '市ID',
  `area_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '区域ID',
  `pro_city_area` varchar(200) NOT NULL DEFAULT '' COMMENT '省市区组合',
  `address_content` varchar(500) NOT NULL DEFAULT '' COMMENT '收货地址',
  `mobile` varchar(100) NOT NULL DEFAULT '' COMMENT '收货人手机号',
  `zip_code` varchar(50) NOT NULL DEFAULT '' COMMENT '邮编',
  `default_address` tinyint(1) NOT NULL DEFAULT '0' COMMENT '默认收货地址',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态：0，新增，9，删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='收货地址';

